  onLoad: function onLoad(option) {
    var _this2 = this;
    //获取高度
    uni.getSystemInfo({
      success: function success(res) {
        _this2.scrollH = res.windowHeight - res.statusBarHeight - 44;
      }
    });
    //监测网络变化
    var _this = this;
    uni.onNetworkStatusChange(function (res) {
      if (!res.isConnected) {
        _this.is_wangluo = false;
        console.log("没网络！");
        uni.showToast({
          icon: 'loading',
          title: '网络错误',
          duration: 200000
        });
      } else {
        _this.is_wangluo = true;
        uni.showToast({
          icon: 'success',
          title: '网络恢复',
          duration: 2000
        });
      }
      return false;
    });
    recorderManager.onStop(function (res) {
      console.log("hhhhh");
      console.log('recorder stop' + JSON.stringify(res));
      _this.voicePath = res.tempFilePath;
    });
    innerAudioContext.onEnded(function () {
      console.log('音频播放结束');
    });
    //更新当前用户ID和房间ID
    this.roomId = option.roomId;
    this.userId = option.userId;

    //创建webscoket对象
    var token;
    if (_mian_store.default.state.token) {
      token = _mian_store.default.state.token;
    } else {
      token = uni.getStorageSync('token');
    }
    var name = 'trainWebsocket';
    var url = "".concat(_config.default.webUrl_vuex, "/ws/train?roomId=").concat(this.roomId, "&token=").concat(token);
    var time = 30;
    this.webscoket = new _webSocket.default(name, url, time);
    this.webscoket.initSocket();
    //初始化邀请list
    this.$H.post("/room/friend_list").then(function (res) {
      console.log(res);
      var data = res.data;
      if (data.code == 200) {
        for (var i = 0; i < data.data.length; i++) {
          _this2.yaoqingList.push({
            "name": data.data[i].userName,
            "image": data.data[i].userImg,
            "sessionId": data.data[i].sessionId,
            "userId": data.data[i].userId,
            "isNike": false
          });
        }
        console.log(_this2.yaoqinglist);
      } else {
        console.log("初始化邀请失败");
      }
    });
  },
  watch: {
    is_my_gechen: function is_my_gechen(newValue, oldValue) {
      //初始化录音
      if (newValue == true) {
        setTimeout(function () {
          var options = {
            // sampleRate: 16000, // 采样率
            format: 'wav',
            // 音频格式
            duration: 600000
          };
          recorderManager.start(options);
          console.log("开始录音！！！！！！！！！！！！！！！！！！！！！！！！");
        }, 3000);
      } else {
        recorderManager.stop();
        console.log("!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!!");
        console.log(this.voicePath);
        this.AI_submit();
      }
      // 在属性变化时执行的代码
      console.log('is_my_gechen属性发生变化，新值为:', newValue);
      // 在这里可以执行其他操作
    }
  },

